-- Tags: long

/* Trivial case */

SELECT CASE WHEN true THEN 2 WHEN true THEN  4 ELSE 5 END;
SELECT CASE WHEN true THEN 'A' WHEN true THEN 'BC' ELSE 'DEF' END;
SELECT CASE WHEN true THEN to_fixed_string('A', 16) WHEN true THEN to_fixed_string('BC', 16) ELSE to_fixed_string('DEF', 16) END;
SELECT CASE WHEN true THEN [1,2] WHEN true THEN [3,4] ELSE [5,6] END;
SELECT CASE WHEN true THEN ['A','B'] WHEN true THEN ['C','D'] ELSE ['E','F'] END;

